// import React, { useEffect, useState } from "react";
import React from "react";
// import Clock from 'react-live-clock';
// import { NavLink } from "react-router-dom";
// import logo from '../images/favicon.png';
import "../index.css";
import "./ownerStyles.css";
// import { FcAlarmClock} from "react-icons/fc";
// import {FaHome,FaPhoneSquareAlt,FaUserCheck} from "react-icons/fa";
// import {FiMenu} from "react-icons/fi";

const Dashboard = () => {

    return (
        <>
    <div className="wrapper">
        <div className="header" id="header">
            <img src="/images/favicon.png"/>
            <h1 style="color:green;">Farmer-Merchant Server</h1>
            
            <div className="datetime"><i className="fa fa-clock-o cls"></i><span id="datetime"></span></div>                      
        </div>

        <div className="navbar" id="navbar">
            <a href="/index.html"><i className="fa fa-home cls"></i>Home</a>
            <a href="enterData.html"><i className="fa fa-edit cls"></i>Data Entry</a>
            <a href="#"><i className="fa fa-folder-open cls"></i>Sales</a>
            <a href="#"><i className="fa fa-server cls"></i>Bills</a>
            <a href="#"><i className="fa fa-ticket cls"></i>Advance</a>
            <a href="#"><i className="fa fa-search cls"></i>Search</a>
            <a href="/index.html" className="search-menu"><i className="fa fa-user cls"></i>Logout</a>
            <a href="#" onClick="document.getElementById('id01').style.display='block'" ><i class="fa fa-user cls"></i>Logout</a>
        </div>
        <div className="search-bar">
            <label for="username">Farmers</label>
            <input type="text"/>
            <label for="username">Merchants</label>
            <input type="text"/>
            <button className="search-btn">Search</button>
        </div>
         {/* <div class="data-btn">
            <a href="/enterData.html"><button class="data-related-btn">Enter Record</button></a>
            <button class="data-related-btn">View Today's Record</button>
        </div>  */}
        <div className="search-bar">
            <label for="username">From Date</label>
            <input type="date"/>
            <label for="username">To Date</label>
            <input type="date"/>
            <label for="username">Of Date</label>
            <input type="date"/>
            <button className="search-btn">Search</button>
        </div>

        <div className="rate-container">
            <h2><u>Today's Latest Entries</u></h2>
            <table>
                <tr>
                    <th>S.No.</th>
                    <th>Farmers</th>
                    <th>Items</th>
                    <th>Weight</th>
                    <th>Rate</th>
                    <th>Merchants</th>
                </tr>
            </table>
        </div>
        <div className="footer" id="contact">
            <a href="#header"><input type="button" value="top"/></a>
            <h3 id="contact">Contact us at </h3>
            <p>Phone : <a href="tel:+919852449826" title="click to call">+91 9852449826</a></p>
            <p>Email : <a href="mailto:narendra0@yahoo.com" title="click to email">narendra0@yahoo.com</a></p>
        </div>
    </div>
    </>
    )
}
export default Dashboard;
